import { Route, Routes, useParams } from "react-router-dom";
import GalleryScrollElement from "./GalleryScrollElement";

const GalleryScroll = (props) => {
  const output = props.data.map((el) => (
    <Route path={"/product/:productId"} key={el.id}>
      <GalleryScrollElement></GalleryScrollElement>
    </Route>
  ));

  return <Routes>{output}</Routes>;
};

export default GalleryScroll;
